import { render } from "@testing-library/react";
import React, { useEffect, useState } from "react";

const GoogleAuth = () => {
  const [signedIn, setsignedIn] = useState();
  useEffect(() => {
    window.gapi.load("client: auth2", () => {
      window.gapi.client
        .init({
          clientId:
            "398671583439-chdv5bu5cish5kdrbfjfdmil9vfsgsnb.apps.googleusercontent.com",
          scope: "email",
        })
        .then((value) => {
          value.auth = window.gapi.auth2.getAuthInstance();
          setsignedIn({ isSignedIn: prop.auth.isSignedIn.get() });
        });
    });
  }, []);

  const renderAuthButton = () => {
    if (signedIn.isSignedIn === null) {
      return <div>no </div>;
    } else if (signedIn.isSignedIn) {
      return <div>yes </div>;
    } else {
      return <div>no </div>;
    }
  };

  return <div>{renderAuthButton}</div>;
};

export default GoogleAuth;
